import React from 'react'
import addMaterials from './pages/addMaterials';
import Navbar from './Components/Navbar/Navbar';
import Materials from './pages/Materials';
import {BrowserRouter,Routes,Route} from 'react-router-dom'; 
const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='/' element={<addMaterials/>}/>
        <Route path='/products' element={<addMaterials/>}/>
        <Route path='/aboutUs' element={<Materials/>}/>
        <Route path='/service' element={<Materials/>}/>
      </Routes>

      </BrowserRouter>
    </div>
  )
}

export default App
